import React from 'react';
import './App.css';

let message = "connexion";

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <button className = "Button" onClick={() => message="Connected"}>
          <p className="Button_police">
            {message}
          </p>
        </button>
        <img src= "/welcome.png" />
      </header>
      <body class Name= "App-header">
        <img src="/cana.png" className="App-logo" alt="logo" />
      </body>
    </div>
  );
}

export default App;
